import React, { Component } from 'react'
//import axios from 'axios'
export default class Holiday extends Component {
    state ={
        holidays: [],
    }
    componentDidMount=()=>{
        fetch('https://sholiday.faboul.se/dagar/v2.1/2015')
        .then(res=>{
            console.log(res);
            this.setState({holidays:res.data});
            
        })
    }
    render(){
         return (
            <ul>
              {this.state.holidays.map(holiday => <li>{holiday.namnsdag}</li>) } 
            </ul>
        )
    }
    }
